window.bookSummaryJSON = "<p>Far too young, Apollo Ulfr lost Ilsa, the love of his life. The grief of her loss does not settle in his soul, it solders to it. When he discovers there’s a parallel universe where his wife may have a twin, he feels there’s hope and sets about bringing her to his world.</p> <p>Ilsa Ulfr of our world is on the run from her husband, Apollo’s twin. The last thing she wants is to be transported to a fantastical world and forced to take his side as his wife.</p> <p>However, trouble catches up with her, and she has no choice. While Ilsa is trying to find her feet in a fairytale world, Apollo finds the broken Ilsa nothing like his beloved.</p> <p>But darkness is looming, and evil is amassing. Apollo must protect his land and keep his family safe. Including the new Ilsa.</p> <p>When circumstances throw them together, sparks fly, and both Ilsa and Apollo are surprised at just how hot those sparks can get.</p>"; 
